//import PropTypes from "prop-types";
import React from "react";

class App extends React.Component {
  state = {
    count: 0
  };

  add = () => {
    this.state.count++;
  };

  minus = () => {
    this.state.count--;
  };

  render() {
    return (
      <div>
        <h1>I'm a class</h1>
        <h2>count:{this.state.count}</h2>
        <button onClick={this.add}>Add</button>
        <button onClick={this.minus}>Minus</button>
      </div>
    );
  }
}

export default App;
